// Automatic terminology replacements.
;(function($) {
  "use strict"
  $.fn.annotate = function(options) {
    const settings = $.extend({ tag: 'abbr', attr: 'title', data: {}}, options);
    const replace_text_nodes = (node, fn)=>{
      const skip = settings.tag.toUpperCase();
      const trv = (node)=>{
        if(node.tagName===skip) return;
        if(node.nodeType==3) {
          return (/\S/.test(node.nodeValue)) ? fn(node) : undefined;
        }
        if(node.childNodes) { // Recursive traversal.
          for(let i=0; i<node.childNodes.length; ++i) {
            const r = trv(node.childNodes[i]);
            if(r) {
              let ins = document.createElement('span');
              ins.innerHTML = r.trim();
              ins = Array.from(ins.childNodes);
              const pn = node.childNodes[i].parentNode;
              let n = ins.shift();
              pn.replaceChild(n, node.childNodes[i]);
              while(ins.length>0) {
                const m = n.nextSibling;
                n = ins.shift();
                pn.insertBefore(n, m);
              }
            }
          }
        }
      }
      trv(node);
    };
    const replacements = (function(){
      const esc = /[-\/\\^$*+?.()|[\]{}]/g;
      return Object.entries(settings.data).map((e)=>{return {
        r: (e[0] instanceof RegExp) ? (e[0]) : (new RegExp("^"+e[0].replace(esc, "\\$&")+"$", "")),
        d: (e[1])
      }}); // regex, word, description.
    })();
    const ht_esc = (word)=>(word.replace(/&/g, "&amp;").replace(/</g, "&lt;").replace(/>/g, "&gt;"));
    const r_start = '<'+settings.tag+' title="';
    const r_end = '</'+settings.tag+'>';
    $(this).get().filter((qsel)=>{
      replace_text_nodes(qsel, (txt_node)=>{
        let replaced = false;
        const words = txt_node.nodeValue.split(/([\s]+)/).map((word)=>{
          if(/\s/.test(word)) return word;
          for(let ri=0; ri<replacements.length; ++ri) {
            if(replacements[ri].r.test(word)) {
              replaced = true;
              return (r_start + ht_esc(replacements[ri].d) + '">' + ht_esc(word) + r_end);
            }
          }
          return word;
        });
        return (!replaced) ? (undefined) : (words.join(""));
      })
    });
    return $(this);
  }

})($);


// Utility
(function(root){
  if(root.util===undefined) root.util={};
  root.util.uriArguments = function(){
    try {
      return Object.fromEntries(new URLSearchParams(window.location.search).entries());
    } catch(ex) {
      console.error("URI parsing URL arguments from query string failed.");
      return {};
    }
  };
  root.util.traceLevel = function(debug){
    if(debug===undefined) { debug = util.uriArguments().debug; }
    if(debug===undefined) { try { debug = localStorage.getItem("debug-trace-level")||""; } catch {} }
    try { debug = Math.max(0, Math.min(5, debug=parseInt(debug||""))); } catch {}
    try { localStorage.setItem("debug-trace-level", debug); } catch {}
    return debug;
  };
  root.util.global = function(key, default_value){
    if(root.util.global.data === undefined) root.util.global.data= {};
    if((root.util.global.data[key]===undefined) && (default_value !== undefined)) root.util.global.data[key] = JSON.parse(JSON.stringify(default_value));
    return root.util.global.data[key];
  };

  // Unified resource access, overridden for local apps.
  root.util.resource = {
    load: function(paths) {
      if(window.location.href.search(/file:\//)>=0) {
        console.info("Cannot load resources for local files, skipping.");
        return $.when().pipe(function(){ return {}; });
      }
      if(!Array.isArray(paths)) paths = [paths];
      const responses = {};
      const deterrents = paths.map((path)=>{
        try {
          return $.ajax({
            url: (window.location.pathname.replace(/\/[^\/]+$/,"/") + "content/")
               + (path.replace(/[^\w\-\.\/_]/ig,"").replace(/^[\/]+/,"").replace(/\.\./g,"").replace(/^content\//,"")),
            cache: false,
            timeout: 5000,
            dataType: 'text',
            success: function(data) { responses[path] = data; }
          })
        } catch(ex) {
          console.error("Resource load exception: ", ex);
        }
      });
      return $.when.apply($, deterrents).pipe(function(){ return responses; });
    },
    save: function(path, content) {
      console.info("resource.save() not available for remotes.");
      return $.when().pipe(function(){ return ""; });
    },
    commit: function(path, content) {
      console.info("resource.commit() not available for remotes.");
      return $.when().pipe(function(){ return ""; });
    },
    list: function(path) {
      return $.when().pipe(function(){ return []; });
    }
  }

})(window);
